import React from 'react';
import GenericForm from './GenericForm';
import TransaccionesModel from './Models/TransaccionesModel';

export default function CiudadForm() {

    const itemSelectResolve = (serviceName, value) => {
        return { value: value.id, label: value.attributes.nombre }
    }

    return (<GenericForm
        formName='TransaccionesAdmin'
        service='TransaccionesAdmin'
        ddlServicesFunction={itemSelectResolve}
        model={TransaccionesModel}
        successRedirect='/TransaccionesAdmin'
    />
    );
};
